properties.script:
// try to get the bearer token from lablink

// important: THE FOLLOWING CODE MUST NOT BE CHANGED

var retryCount = 0;
var retry = true;
while  (retry === true) {
	var response = router.routeMessage('ll get token', '');

	var httpStatus = response.getStatusMessage() + '';
	responseStatusMessage = httpStatus;
	switch (httpStatus) {
		case '200':
			var token = JSON.parse(response.getMessage());
			channelMap.put('token', token.access_token);
			retry = false;
			return true;
			break;
		default:
			if (retryCount < 5) {
				java.lang.Thread.sleep(5000);
				retryCount++;
			} else {
				logger.error('>>ll send orders to lablink answer Get Token FAILED<<');
				retry = false;
				return false;	
			}
	}
}

// try to get analytes from lablink

// important: THE FOLLOWING CODE MUST NOT BE CHANGED

var token = $('token');
var sendMsg = {'token': $('token')};
var response = router.routeMessage('ll read analytes', JSON.stringify(sendMsg));

var httpStatus = response.getStatusMessage() + '';
switch (httpStatus) {
	case '200':
		var analytes = JSON.parse(response.getMessage());
		channelMap.put('analytes', analytes);
		return true;
		break;
	default:
		logger.error('Read analytes failed: ' + response.getMessage());
		return false;
}

// try to get locations from lablink

// important: THE FOLLOWING CODE MUST NOT BE CHANGED

var token = $('token');
var sendMsg = {'token': $('token')};
var response = router.routeMessage('ll read institute locations', JSON.stringify(sendMsg));

var httpStatus = response.getStatusMessage() + '';
switch (httpStatus) {
	case '200':
		var location = JSON.parse(response.getMessage());
		var locationID = location.items[0].id;
		channelMap.put('locationID', locationID);
		return true;
		break;
	default:
		logger.error('Read locationID failed: ' + response.getMessage());
		return false;
}

com.mirth.connect.plugins.javascriptstep.script:
// convert order file for lablink api

var locationId = $('locationID');

var analytes = $('analytes');
var ordermessage = $('ordermessage');
var orders = [];
var sampleIDCompare = '';

for each (msgRow in $('ordermessage')['row']) {
	var sampleID = msgRow['column1'].toString();
	if (sampleID != sampleIDCompare) {
		if (sampleIDCompare != '') {
			orders.push(order);	
		}
		var order = {'locationId': locationId, 
			'reference':'MirthTest',
			'type':'PSEUDONYMIZED', 
			'examinations':[],
			'pseudonym':{'code':'MirthTest'}
		};
		sampleIDCompare = sampleID;
	}
	var orderExamination = {'id': '', 
		'sampleCodes':[], 
		'sampleDate':msgRow['column6'].toString(),
		'sampleTime':'00:00:01'
	}
	orderExamination.sampleCodes.push(sampleID);

	var code = msgRow['column3'].toString();
	for each (item in analytes.items) {
		if (code === item.code) {
			orderExamination.id = item.id;
	    		order.examinations.push(orderExamination);
	    		break;	
		}
	}

}
if (sampleIDCompare != '') {
	orders.push(order);
};
channelMap.put('orders', JSON.stringify(orders));

// validate response from lablink api after sent orders
// save orderfile with prefix "OK_" if everything is ok
// save orderfile with prefix "ERR_" if an error has occurred
// delete original file
// feel free to edit file handling

var responseStatusLine = $('responseStatusLine')
var responseCode = parseInt(responseStatusLine.split(' ')[1], 10);

const orderfileRead = $('fileDirectory') + '\\' + $('originalFilename');
var orderfileSave = '';

if (responseCode == 200) {
	orderfileSave = $('fileDirectory') + '\\OK_' + $('originalFilename');
	logger.info('Lablink sent successful file ' + $('originalFilename'));

} else {
	orderfileSave = $('fileDirectory') + '\\ERR_' + $('originalFilename');
	logger.error('Lablink sent file ' + $('originalFilename') + ' failed: ' + response.getMessage());
}

var fileContent = FileUtil.read(orderfileRead);
FileUtil.write(orderfileSave, false, fileContent)

var File = java.io.File;
if (FileUtil.deleteFile(new File(orderfileRead))) {
    logger.info('File '+ orderfileRead +' successfully deleted.');
}
else {
    logger.error('File could not be deleted.');
}

